from Leetcode_type import *


class Solution:
    def carFleet(self, target: int, position: List[int], speed: List[int]) -> int:
        N = len(speed)
        if N == 0:
            return 0
        arrive = [(target-position[i])/speed[i] for i in range(N)]
        new = [(position[i], arrive[i]) for i in range(N)]
        new.sort(key=lambda x: x[0])
        count = 0
        max_time = 0
        for car in new[::-1]:
            if car[1] > max_time:
                count += 1
                max_time = car[1]
        return count


